objetoCompra:
As atividades desenvolvidas pelos Peritos Criminais na área de Genética Forense do ITEP requerem a operação de vários equipamentos de instrumentação analítica. Nesse contexto, destaca-se o Sistema Milli-Q Direct 8/16, que é um purificador de água que fornece água ultrapura, essencial para uso em laboratórios.

Para minimizar possíveis depreciações e mantê-lo em boas condições de operação e, assim garantir que resultados obtidos sejam precisos e confiáveis, é necessária a contratação de serviço de manutenção para esse equipamento.

Diante da necessidade de aquisição de contrato de manutenção para atender as demandas apresentadas, na solução escolhida para aquisição deverão ser contemplados por parte da contratada, os critérios técnicos conforme o descritivo a seguir.

Contrato de manutenção preventiva e corretiva para Sistemas Milli-Q Direct 8/16: com um prazo de vigência da contratação de 01 (um) ano, contado da assinatura contratual, prorrogável por até 10 anos, na forma dos artigos 106 e 107 da Lei n° 14.133, de 2021. com cobertura dos seguintes serviços:

Manutenções corretivas ilimitadas;

Uma manutenção preventiva anual;

Incluir todas as peças necessárias para as manutenções corretivas;
Todas as despesas de viagem e horas técnicas inclusas;
Todos os consumíveis do checklist da Manutenção Preventiva;

Prioridade no tempo de resposta do time de suporte;

Participação no 12º Contratos Week
2.1 se deve à necessidade de qualificação da servidora para atuar diretamente na Gestão e Fiscalização de Contratos do AN;
2.2 de modo a aplicar os conhecimentos obtidos de maneira eficiente, possibilitando maior adequação do órgão às orientações do governo federal, a fim de prevenir diligências dos órgãos de controle.

Realização de revisão com mão de obra e peças de veiculo em garantia.
